import React, { Component } from 'react';
import NavBar from './components/navbar';
import { Routes, Route } from 'react-router-dom'

const App = () => {
  return ( 
    <React.Fragment>
      <NavBar />
      <Routes>
        <Route />
      </Routes>
    </React.Fragment>
    
  );
}

export default App
